import React, { lazy, Suspense } from 'react';
import { Route, Routes } from 'react-router-dom';

const Home = lazy(() => import('../pages/Home'));
const AllMovie = lazy(() => import('../components/AllMovie/AllMovie'));
const MovieDetail = lazy(() => import('../pages/detail/MovieDetail'));

const Content = () => {
  return (
    <Routes>
      <Route
        path="/"
        element={
          <Suspense fallback={<h2>Loading...</h2>}>
            <Home />
          </Suspense>
        }
      />
      <Route
        path="/:category"
        element={
          <Suspense fallback={<h2>Loading...</h2>}>
            <AllMovie />
          </Suspense>
        }
      />
      <Route
        path="/:category/search/:kw"
        element={
          <Suspense fallback={<h2>Loading...</h2>}>
            <AllMovie />
          </Suspense>
        }
      />
      <Route
        path="/:category/:id"
        element={
          <Suspense fallback={<h2>Loading...</h2>}>
            <MovieDetail />
          </Suspense>
        }
      />
    </Routes>
  );
};

export default Content;
